import React, { useState } from 'react';
import "./MenuNav.css";
import { NavLink, useLocation } from 'react-router-dom';
import { UserInfo } from '../../login/UserInfo';

export const MenuNav = () => {
    const [menuSelected, setMenuSelected] = useState(null);
    const [subMenuOpen, setSubMenuOpen] = useState(null);
    const location = useLocation();

    const handleNavLinkClick = (url) => {
        console.log('Navigating to:', url);
        setMenuSelected(url);
        // Cierra el submenú cuando se selecciona un enlace principal
        setSubMenuOpen(null);
    }

    const handleSubMenuClick = (url) => {
        setSubMenuOpen(url);
    }

    return (
        <div className='menu-nav'>
            <div>
                <UserInfo />
            </div>
            <nav>
                <ul>
                    <li>
                        <NavLink
                            className={({ isActive }) => isActive || menuSelected === "/Layout/Clientes" ? "navlink-activo" : "navlink"}
                            to="/Layout/Clientes"
                            onClick={() => handleSubMenuClick("/Layout/Clientes")}
                        >
                            Clientes
                        </NavLink>
                        <div className={`sub-menu-nav ${subMenuOpen === "/Layout/Clientes" ? "visible" : ""}`}>
                            <ul>
                                <li>
                                    <NavLink
                                        className={({ isActive }) => isActive ? "navlink-activo" : "navlink"}
                                        to="/Layout/Clientes/Listado"
                                        onClick={() => handleNavLinkClick("/Layout/Clientes/Listado")}
                                    >
                                        Listado Clientes
                                    </NavLink>
                                </li>
                                <li>
                                    <NavLink
                                        className={({ isActive }) => isActive ? "navlink-activo" : "navlink"}
                                        to="/Layout/Clientes/Agregar"
                                        onClick={() => handleNavLinkClick("/Layout/Clientes/Agregar")}
                                    >
                                        Agregar Cliente
                                    </NavLink>
                                </li>
                                <li>
                                    <NavLink
                                        className={({ isActive }) => isActive ? "navlink-activo" : "navlink"}
                                        to="/Layout/Clientes/Detalles"
                                        onClick={() => handleNavLinkClick("/Layout/Clientes/Detalles")}
                                    >
                                        Detalles del Cliente
                                    </NavLink>
                                </li>
                            </ul>
                        </div>
                    </li>
                    <li>
                        <NavLink
                            className={({ isActive }) => isActive || menuSelected === "/Layout/OT" ? "navlink-activo" : "navlink"}
                            to="/Layout/OT"
                            onClick={() => handleSubMenuClick("/Layout/OT")}
                        >
                            Ordenes de Trabajo
                        </NavLink>
                        <div className={`sub-menu-nav ${subMenuOpen === "/Layout/OT" ? "visible" : ""}`}>
                            <ul>
                                <li>
                                    <NavLink
                                        className={({ isActive }) => isActive ? "navlink-activo" : "navlink"}
                                        to="/Layout/Calendario"
                                        onClick={() => handleNavLinkClick("/Layout/Calendario")}
                                    >
                                        Calendario
                                    </NavLink>
                                </li>
                            </ul>
                        </div>
                    </li>
                    <li>
                        <NavLink
                            className={({ isActive }) => isActive || menuSelected === "/Layout/Formulario" ? "navlink-activo" : "navlink"}
                            to="/Layout/Formulario"
                            onClick={() => handleNavLinkClick("/Layout/Formulario")}
                        >
                            Formulario O.T.
                        </NavLink>
                    </li>
                    <li>
                        <NavLink
                            className={({ isActive }) => isActive || menuSelected === "/Layout/configuracion" ? "navlink-activo" : "navlink"}
                            to="/Layout/configuracion"
                            onClick={() => handleSubMenuClick("/Layout/configuracion")}
                        >
                            Configuración
                        </NavLink>
                        <div className={`sub-menu-nav ${subMenuOpen === "/Layout/configuracion" ? "visible" : ""}`}>
                            <ul>
                                <li>
                                    <NavLink
                                        className={({ isActive }) => isActive ? "navlink-activo" : "navlink"}
                                        to="/Layout/configuracion/usuarios"
                                        onClick={() => handleNavLinkClick("/Layout/configuracion/usuarios")}
                                    >
                                        Usuarios
                                    </NavLink>
                                </li>
                            </ul>
                        </div>
                    </li>
                </ul>
            </nav>
        </div>
    )
}
